        		+ " c -7,-10 -13,-10 -20,0 "
        		+ " c -7,10 -7,20 0,30  "
        		+ " c 7,10 13,10 20,0  "
        		+ " c 7,-10 7,-20 0,-30  "
        		+ "z"
        		+ "M 300 300 "
        		+ " m 20,0 0,30 -20,0 0,-30 z"
        		+ " c -7,-10 -13,-10 -20,0 "
        		+ " c -7,10 -7,20 0,30  "
        		+ " c 7,10 13,10 20,0  "
        		+ " c 7,-10 7,-20 0,-30  "
        		+ "z"
				;
		PathPrimitiveList primitives = new SVGPathParser().parseDString(d);
		SVGPath path = new SVGPath(primitives, null);
